Bom dia galera, Kojima revela que voz do bebê de Death Stranding poderá ser ouvida no DualShock 4.📸🎮
-
_
(Notícias)🗞⤵️
_

Death Stranding terá uma funcionalidade peculiar: de acordo com Hideo Kojima, você poderá ouvir o Bridge Baby do game através do DualShock 4.
.
A funcionalidade pode ser ativada ou desativada nas configurações do game. O jogo será lançado em 8 de novembro para Playstation 4.
_
"Após configurar, você poderá ter a voz do BB saindo deste controle BBish"
_
.
Só não ficou claro se esta função será disponível para todos os controles DualShock 4 ou apenas a sua versão especial temática do game que está prestes a ser lançado.
.
Sam Bridges precisa se aventurar num mundo transformado. Carregando os restos de nosso futuro em suas mãos, ele embarca numa jornada para reunir o mundo despedaçado.
